import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Provider } from 'react-redux';


ReactDOM.render(
  <Provider>
    <React.StrictMode>
    <App />

  </React.StrictMode>,

  document.getElementById('root')
  </Provider>
);

